import React, { Component} from 'react';
import Header from './header';
import Info from './info'
import { Container, Row, Col } from 'reactstrap';
class Dashboard extends Component {
    render() {
        return (
            <div>
                <Header />
                <Container>
                <Row xs="10" sm="10">
                    <Col xs="10">
                        <Info />
                    </Col>
                    <Col xs="6" sm="4">
                        <Info />
                    </Col>
                </Row>
                </Container>
            </div>
                )
    }

}

export default Dashboard;
